textOriginal:
É momento de cobrar ao TSE casos:
Urnas danificadas e substituídas na continuidade da votação;
Eleitores não encontrarem suas Zonas Eleitorais;
Problema na leitura da Biometria.
Além dos atrasos nas filas por mesários partidários da esquerda. 18:04 Nesses casos deve-se chamar o fiscal da Zona eleitoral e se possível fazer uma ocorrência policial.
